import React from 'react';
import ExpenseItem from '../ExpenseItem/ExpenseItem'
import Card from '../../UI/Card/Card';
import './Expenses.css'
function Expenses (props){

    return(
        <Card className='expenses'>

            {props.items.map((item)=>(
            <ExpenseItem 
                title= {item.title}
                amount = {item.amount}
                date={item.date}/>))}


        </Card>
    )
}
export default Expenses;
